import React, { Component } from "react";
import { Link } from "react-router-dom";
import "./css/navbar.css";
export default class NavbarArea extends Component {
    render() {
        return (
            <div>
            <nav className="navbar-padding navbar navbar-expand-lg navbar-background ">
                <a className="navbar-brand" href="/">Exercise App</a>
                <button className="navbar-toggler nav-button-styles" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                    <span className="navbar-toggler-icon"></span>
                </button>
                <div className="collapse navbar-collapse navbar-ul" id="navbarSupportedContent">
                    <ul className="navbar-nav mr-auto">
                        <li className="nav-item active navbar-ul-li">
                            <Link className="nav-link" to="/">Exercises <span className="sr-only">(current)</span></Link>
                        </li>
                        <li className="nav-item active navbar-ul-li">
                            <Link className="nav-link" to="/CreateUser">Create USer <span className="sr-only">(current)</span></Link>
                        </li>
                        <li className="nav-item active navbar-ul-li">
                            <Link className="nav-link" to="/CreateExercise">Create Exercise <span className="sr-only">(current)</span></Link>
                        </li>
                    </ul>
                </div>
            </nav>
            </div>
        )
    }
}
